import React, { useState, useEffect } from 'react';
import actions from '../api';

function SeeGoal(props) {
    const [goals, setGoals] = useState()

    useEffect(() => {
        async function getGoals() {
            let res = await actions.getAllGoals()
            console.log(res)
            setGoals(res.data)
        }
        getGoals()
    }, [])
    return (
        <div>
            see goal?
        </div>
    );
}

export default SeeGoal;
